using Api.DTOs;
using Api.Services;
using Microsoft.AspNetCore.Mvc;

namespace Api.Endpoints;

public static class AiEndpoints
{
    public static RouteGroupBuilder MapAiEndpoints(this WebApplication app)
    {
        RouteGroupBuilder group = app.MapGroup("/api/ai")
            .WithTags("AI");

        group.MapGet("test", async (IAiService aiService) =>
            {
                using MemoryStream ms = new(Convert.FromBase64String("data:image/jpeg;base64,"));
                AIResponse response =  await aiService.AnalyzeImageAsync(new AIRequest() { Image = ms });
                return Results.Ok(response);
            })
            .WithName("GetTestResponse")
            .Produces<string>(StatusCodes.Status200OK);

        return group;
    }

}
